import React from "react";
import { Nav } from "react-bootstrap";
import { Navbar } from "react-bootstrap";
import { Container } from "react-bootstrap";
import { FormControl } from "react-bootstrap";
import { MdSearch } from 'react-icons/md';
import { Button } from "react-bootstrap";
import { Modal } from "react-bootstrap";

const LogNavbar = (props) => {
    return (
        <div>
            <Navbar id="LogNavbar" variant="dark" expand="lg">
                <Container>
                    <Navbar.Brand href="#home">List Factory</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link href="#home">Inicio</Nav.Link>
                            <Nav.Link href="#movies">Pel√≠culas</Nav.Link>
                            <Nav.Link href="#series">Series</Nav.Link>
                        </Nav>
                        <FormControl
                            id="SearchBar"
                            placeholder="Buscar..."
                            aria-label="Search"
                            aria-describedby="inputGroup-sizing-sm"
                        />
                        <a href="###"><MdSearch class="search-icon" /></a>
                        <Button className="btnEntrar" variant="light">Entrar</Button>{' '}
                        <Button className="btnRegistrate" variant="outline-light">Registrate</Button>{' '}
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </div>
    )
}
function MyVerticallyCenteredModal(props) {
    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >
            <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                    Modal heading
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <h4>Centered Modal</h4>
                <p>
                    Cras mattis consectetur purus sit amet fermentum. Cras justo odio,
                    dapibus ac facilisis in, egestas eget quam. Morbi leo risus, porta ac
                    consectetur ac, vestibulum at eros.
                </p>
            </Modal.Body>
            <Modal.Footer>
                <Button onClick={props.onHide}>Close</Button>
            </Modal.Footer>
        </Modal>
    );
}

export default LogNavbar;
